(()=>{"use strict";const t=new class{constructor(){this.num1Inpt=document.getElementById("num1"),this.num2Inpt=document.getElementById("num2"),this.btn=document.getElementById("btn"),this.result=document.getElementById("result")}showResult(t){this.result.innerHTML=t}getResult(t){return t.reduce(((t,e)=>t+e),0)}getInputs(){return[this.num1Inpt.value,this.num2Inpt.value]}clickEvent(t){this.btn.addEventListener("click",t)}};t.clickEvent((()=>{const e=t.getInputs().map((t=>parseInt(t))),n=t.getResult(e);t.showResult(n)}))})();